import { Redirect } from "react-router-dom";
import { useSelector } from "react-redux";

function PrivateRoute ({ children }) {

    const user = useSelector((state) => state.user)

    if (!user.username) {
        return <Redirect to="/login" />;
    }

    return children;
};

export default PrivateRoute
